import React, {useState, useEffect, useContext} from "react";
import faceContext from "../../context/face/faceContext";

const Nivel = ({id}) => {
	const facesContext = useContext(faceContext);
	const {faceByConfidenceLevel, faces_filtrados} = facesContext;
	const [vayalo, setVayalo] = useState([]);

	useEffect(() => {
		const getUsers = async () => {
			await faceByConfidenceLevel(id);
			setVayalo(faces_filtrados);
		};
		getUsers();
	}, []);

	console.log(vayalo);
	return (
		<div>
			{/* vayalo?.map((face) => (
				<h1 key={face._id}>{face.name}</h1>
            ))*/}
		</div>
	);
};

export default Nivel;
